import React, { FC } from 'react';

import { Typography } from "antd";
import { Game } from "../types";


const { Text } = Typography;

const Item: FC<Game> = ({id, creator}) => {
    return (
        <>
            <Typography.Text><Text keyboard>{id}</Text> {creator}</Typography.Text>
        </>
    );
}

export default Item;
